import React from 'react';
import { View, StyleSheet } from 'react-native';
import { Text, Input, Button } from 'react-native-elements';
import Spacer from '../components/Spacers';
const SigninScreen = ({ navigation }) => {

    return (
        <View style={styles.containers}>
            <Spacer>
                <Text h4 > Sign in for Tracker Screen</Text>
            </Spacer>


            <Spacer />

            <Input
                label="Email"
                autoCapitalize="none"
                autoCorrect={false}
            />

            <Input
                label="Password"
                autoCapitalize="none"
                autoCorrect={false}
                secureTextEntry
            />

            <Spacer />

            <Spacer>
                <Button title="Sign In" onPress={() => navigation.navigate('Singup')} />
            </Spacer>

            <Spacer>
                <Button title="Home Screen" onPress={() => navigation.navigate('mainFlow')} />
            </Spacer>

        </View>
    );


};


SigninScreen.navigationOptions = () => {
    return {
        header: null
    };
};

const styles = StyleSheet.create({
    containers: {
        flex: 1,
        borderWidth: 10,
        borderColor: 'red',
        justifyContent: 'center',
        marginBottom : 250

    }
});

export default SigninScreen;
